    false,nt"url": null,nt"notes": "This is an unpublished report that contains
    a review of the Institute of Archeology and Anthropology's work relating to the
    Scott's Lake Site. The changes of the lake, the paved road, the stone rip-rap protecting
    the beach, the forest of young trees, the wooden breakwateru2014these physical things
    of this Historic Site are of today, and there is very little to remind people of
    the way things were before the "modern age". Here, visitors are on an important
    place in the prehistory and history of South Carolina. It is a place where Indians
    built a religious center many years before the sails of European ships were seen
    slipping by the sea islands. It isa place where British and Provincial soldiers
    lived and fought in a vain attempt to maintain the colony of South Carolina for
    His Majesty King George III of England. Yet, there is little to help the visitor
    know and understand the events that took place here on the banks of the Santee River.
    If they have an image of past events they are most often those conjured by the "movieland"
    version of Indians or the television rendition of Francis Marion as the elusive
    Swamp Fox.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
